import karaoke from './images/001-karaoke.png';
import guitar from './images/002-guitar.png';
import musicPlayer from './images/003-music-player.png';
import cdPlayer from './images/004-cd-music.png';
import microphone from './images/005-microphone.png';
import maracas from './images/006-maracas.png';
import piano from './images/007-piano.png';
import drums from './images/008-drum.png';
import tabmourine from './images/009-tabmourine.png';
import trumpet from './images/010-trumpet.png';
import drumSet from './images/011-drumSet.png';
import harmonica from './images/012-harmonica.png';
import harp from './images/013-harp.png';
import boomBox from './images/014-boomBox.png'


const images = [
  karaoke,
  guitar,
  musicPlayer,
  cdPlayer,
  microphone,
  maracas,
  piano,
  drums,
  tabmourine,
  trumpet,
  drumSet,
  harmonica,
  harp,
  boomBox
];

export default images;
